import React, { useState } from 'react';
import { Form, Input, Button, Typography, message, Checkbox } from 'antd';
import { UserOutlined, LockOutlined, MailOutlined, EyeInvisibleOutlined, EyeTwoTone, WechatOutlined } from '@ant-design/icons';
import { authService } from '../../services/authService';
import './Auth.css';

const { Title, Text } = Typography;

interface RegisterForm {
  username: string;
  email: string;
  password: string;
  confirmPassword: string;
  agreement: boolean;
}

interface RegisterProps {
  onRegisterSuccess?: () => void;
  onSwitchToLogin?: () => void;
}

export const Register: React.FC<RegisterProps> = ({ onRegisterSuccess, onSwitchToLogin }) => {
  const [form] = Form.useForm();
  const [loading, setLoading] = useState(false);

  const onFinish = async (values: RegisterForm) => {
    setLoading(true);
    try {
      const result = await authService.register({
        username: values.username,
        email: values.email,
        password: values.password
      });

      if (result.success) {
        message.success('注册成功！');
        onRegisterSuccess?.();
        // 注册成功后，页面会自动刷新并重定向到主页面
        window.location.reload();
      } else {
        message.error(result.message || '注册失败，请重试');
      }
    } catch (error: any) {
      message.error(error.message || '注册失败，请重试');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="auth-form-container">
      <div className="auth-header">
        <Title level={2} className="auth-title">
          创建账户
        </Title>
        <Text className="auth-subtitle">
          开始您的投资之旅
        </Text>
      </div>

      <Form
        form={form}
        name="register"
        onFinish={onFinish}
        layout="vertical"
        size="large"
        className="auth-form"
      >
        <Form.Item
          name="username"
          rules={[
            { required: true, message: '请输入用户名' },
            { min: 3, message: '用户名至少3个字符' },
            { max: 20, message: '用户名不能超过20个字符' },
            { pattern: /^[a-zA-Z0-9_]+$/, message: '用户名只能包含字母、数字和下划线' }
          ]}
        >
          <Input
            prefix={<UserOutlined className="input-icon" />}
            placeholder="用户名"
            className="auth-input"
          />
        </Form.Item>

        <Form.Item
          name="email"
          rules={[
            { required: true, message: '请输入邮箱地址' },
            { type: 'email', message: '请输入有效的邮箱地址' }
          ]}
        >
          <Input
            prefix={<MailOutlined className="input-icon" />}
            placeholder="邮箱地址"
            className="auth-input"
          />
        </Form.Item>

        <Form.Item
          name="password"
          rules={[
            { required: true, message: '请输入密码' },
            { min: 6, message: '密码至少6个字符' },
            { pattern: /^(?=.*[a-zA-Z])(?=.*\d)/, message: '密码必须包含字母和数字' }
          ]}
        >
          <Input.Password
            prefix={<LockOutlined className="input-icon" />}
            placeholder="密码"
            className="auth-input"
            iconRender={(visible) => (visible ? <EyeTwoTone /> : <EyeInvisibleOutlined />)}
          />
        </Form.Item>

        <Form.Item
          name="confirmPassword"
          dependencies={['password']}
          rules={[
            { required: true, message: '请确认密码' },
            ({ getFieldValue }) => ({
              validator(_, value) {
                if (!value || getFieldValue('password') === value) {
                  return Promise.resolve();
                }
                return Promise.reject(new Error('两次输入的密码不一致'));
              },
            }),
          ]}
        >
          <Input.Password
            prefix={<LockOutlined className="input-icon" />}
            placeholder="确认密码"
            className="auth-input"
            iconRender={(visible) => (visible ? <EyeTwoTone /> : <EyeInvisibleOutlined />)}
          />
        </Form.Item>

        <Form.Item
          name="agreement"
          valuePropName="checked"
          rules={[
            { required: true, message: '请同意用户协议和隐私政策' }
          ]}
        >
          <Checkbox className="auth-checkbox">
            我已阅读并同意 <a href="#" className="auth-link">用户协议</a> 和 <a href="#" className="auth-link">隐私政策</a>
          </Checkbox>
        </Form.Item>

        <Form.Item>
          <Button
            type="primary"
            htmlType="submit"
            loading={loading}
            className="auth-button"
            block
          >
            {loading ? '注册中...' : '创建账户'}
          </Button>
        </Form.Item>
      </Form>

      <div className="auth-divider">
        <span>或</span>
      </div>

      <div className="social-login">
        <Button 
          className="social-btn wechat-btn"
          icon={<WechatOutlined />}
          block
        >
          微信注册
        </Button>
      </div>

      <div className="register-link">
        已有账户？
        <Button type="link" onClick={onSwitchToLogin} className="register-btn">
          立即登录
        </Button>
      </div>
    </div>
  );
};

export default Register;
